import React from 'react';
import './Sidebar';
import Form from './Form';
import Table from './Table';
import '../styles/MainBodyStyles.css';

function MainBody({ selectedLink }) {
  return (
    <div>
      if(selectedLink === 'form')
      {<Form />}
      else if(selectedLink === 'table')
      {<Table />}
      else{<h1>Select a menu</h1>}
    </div>
  );
}

export default MainBody;
